    },
    {
      "type": "paragraph",
      "text": "The Sixth Session of the Fifth USSR Supreme Soviet opened in Moscow on December 20, 1960. Here Foreign Minister Andrei A. Gromyko reports on the international situation and the foreign policy of the Soviet Union. Vladimir N. Novikov, Deputy Chairman of the USSR Council of Ministers and Chairman of the State Planning Committee, speaks on the 1961 State Plan for Economic Development at a joint session of the Soviet of the Union and the Soviet of Nationalities.",
      "bbox": {
