        "width": 100,
        "height": 20
      }
    },
    {
      "type": "image",
      "text": "Vasili F. Garbuzov, USSR Minister of Finance, presented the State Budget for 1961 and reported on the fulfillment of the 1959 budget. The current budget provides for 78.9 billion rubles in revenue and 77.5 billion rubles in expenditures.",
      "bbox": {
        "x": 0,
        "y": 270,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The many foreign diplomats present at the session witnessed the deputies' wholehearted approval of the State Budget proposed for 1961, the 1961 State Plan for Economic Development and the report on the government's peace-loving foreign policy.",
      "bbox": {
        "x": 0,
        "y": 290,
        "width": 100,
        "height": 10
      }
    },
    {
      "type": "image",
      "text": "A group of deputies get together between sessions. (Left to right) R. I. Samsonov, pattern-maker of the Ukhtonsky Agricultural Machinery Works; V. G. Blazhenov, Moscow railway engineer; A. M. Gorev, team leader of the Moszkilstroi (Moscow Housing Trust); A. N. Bakulev, outstanding surgeon.",
      "bbox": {
        "x": 0,
        "y": 300,
        "width": 100,
        "height": 15
      }
    },
    {
      "type": "paragraph",
      "text": "10.SOVIET DIARY A HISTORICAL EVENT THE PLENUM of the Central Committee of the Communist Party of the Soviet Union held in Moscow in January adopted a decision to convene the Twenty-second Congress of the CPSU on October 17, 1961. The Party Congress is a historical event in the life of our country. Each Communist Party Congress marks a new milestone on the road to communism, each Congress presents a concrete program of Party activity. The decisions of Party Congresses have great political authority and mobilizing power in our society because the Communist Party has the trust and support of all the Soviet people.",
      "bbox": {
        "x": 0,
        "y": 315,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The Twenty-second Congress will sum up the results of the Party's activity since 1959 and discuss the most important problems facing the Communist Party and the Soviet people today. A major point on the agenda of the Twenty-second Congress will be the adoption of a new Party program on the construction of communism in the country. The decision to work out a new program, as is known, was adopted in March 1939, at the Eighteenth Party Congress, but the Second World War and other events postponed discussion on this decision.",
      "bbox": {
        "x": 0,
        "y": 335,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "Now we are able to see ahead with broader vision, said Nikita S. Khrushchev. The Party has amassed a great deal of experience, and, on the basis of this experience, on the basis of our success in developing our country, it is now possible to work out a more detailed program. . . . Great changes have taken place in the life of the country and of all mankind since the Party's present program was adopted in March 1919 at the Eighth Congress. As a result of the fulfillment of this program, the Soviet Union, in a brief historical period, has become a powerful socialist power with a prosperous economy, advanced science and culture, and undefeatable defensive might. This accomplished, the Communist Party is now leading the Soviet people in completing the construction of a communist society.",
      "bbox": {
        "x": 0,
        "y": 355,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The Plenum also discussed new measures on the development of agriculture, summed up the results of work already accomplished and outlined a program for the further growth of collective farm and state farm production. A BIG SHIP NEEDS DEEP WATER TALKING ABOUT the size of the national budget for 1961 adopted at the December session of the Supreme Soviet, the people say, A big ship needs deep water. The budget calls for revenues of 78.9 billion rubles and expenditures of 77.5 billion — this is in terms of the new ruble. It was approved after lively debate, with deputies from every part of the country presenting their reactions and the special needs of their constituents.",
      "bbox": {
        "x": 0,
        "y": 375,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "Deputy V. Klimenko from the Donbas proposed the construction of a new canal in his region. A deputy from Estonia, V. Klauson, asked for expansion of the republic's local industry. Deputy Batiyev wanted new oil refineries built in the fast growing Tatar Autonomous Republic he represents. Scores of such similar proposals and amendments were made and thoughtfully debated. Previous to the presentation of the 1961 draft budget, the deputies, assembled in the Grand Kremlin Palace, heard reports on the progress of the seven-year plan now entering on its third year. They indicated that during the first two years of the plan, 1959 and 1960, the plan was not only fulfilled, but overfulfilled.",
      "bbox": {
        "x": 0,
        "y": 395,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "In these two years capital investment totaled nearly 490 billion rubles, a sum greater than was spent in all the 22 prewar years combined. More than 2,000 large new plants went into operation. In 1960 steel production increased by 5 million tons, cement by 6.5 million tons and oil by approximately 18 million tons. Electric power production was boosted by some 30 billion kilowatt-hours. The absolute increase in industrial production in 1960 tops the very highest previous results. Figures for the consumer industries showed that 202 million yards of textiles, millions of pairs of shoes and many other consumer goods were produced over and above the plan.",
      "bbox": {
        "x": 0,
        "y": 415,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The 1961 plan adopted by the Supreme Soviet foresees an increase of almost 9 per cent in volume of industrial production over 1960. During the year another three million factory and office workers will be added to the country's payroll. Wages will rise again. Additional millions of rubles' worth of consumer goods will be stocking the country's retail stores. Ten million people will move to new apartments. College enrollment will increase by five million. Additional appropriations of many millions of rubles will go to the further expansion of consumer goods production.",
      "bbox": {
        "x": 0,
        "y": 435,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "A notable feature of the 1961 budget is the cut in military expenditures of some nine billion rubles following on the law passed last year that reduced the country's armed forces by 1,200,000 men. The defense item for 1961 is 11.9 per cent of the budget as against 12.9 per cent for 1960 and 19.9 per cent for 1955. While expenditures for defense keep decreasing, those for social and cultural services keep increasing. The sums allocated to education, science, culture, health, social insurance and other welfare items will add up to more than a third of the entire national budget.",
      "bbox": {
        "x": 0,
        "y": 455,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "WORLD'S LARGEST POWER PROJECT THE STALINGRAD Hydroelectric Station's twenty-first and final turbogenerator began producing commercial current on December 9, 1960. The station, the world's largest, will have a twenty-second turbogenerator, but it will be a purely experimental installation, a research laboratory for future stations. The aggregate capacity of all the Stalingrad turbines, 2,415,000 kilowatts, exceeds that of the Lenin Hydroelectric Station near Kuibyshev, until now the world's largest, by 150,000 kilowatts. These two giant projects and the Ivankovo, Uglich, Rybinsk, Gorky and Kama Hydroelectric Stations are units in the series on the Volga and the Kama, its tributary.",
      "bbox": {
        "x": 0,
        "y": 475,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The Stalingrad's rated capacity is 2,563,000 kilowatts, and its annual average output will range from 11 to 14 billion kilowatt-hours, depending upon the water level of the Volga. Besides feeding additional power to Moscow, the Volga and Central Black-Soil regions of the Russian Federation, the Donets Coal Basin and other industrial areas, the project will irrigate 18.5 million acres in the fertile but arid sections of the Lower Volga and the Caspian lowland, and will speed shipping in the Volga's lower reaches. The Stalingrad project was completed a year ahead of schedule as a result of new engineering approaches.",
      "bbox": {
        "x": 0,
        "y": 495,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "Construction was done on a continuous-flow basis to cut building time and costs. A new powerhouse design made it possible to reduce the length of the spillway dam by a third. These and other radical solutions are being incorporated in other projects under construction on the Volga and elsewhere to supply the country with cheap electricity. The seven-year plan forecasts an output of power of 500 to 525 billion kilowatt-hours a year by 1965, more than double the 1958 level.",
      "bbox": {
        "x": 0,
        "y": 515,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "headline",
      "text": "ONE PARTY—THE POLICY OF 200,000,000",
      "bbox": {
        "x": 0,
        "y": 535,
        "width": 100,
        "height": 10
      }
    },
    {
      "type": "paragraph",
      "text": "By Andrei Kuchkin Historian THERE IS ONLY one political party in our country—the Communist Party of the Soviet Union (CPSU). This specific feature of the political life of our society seems puzzling to some people. They claim that it is abnormal and undemocratic. This is an altogether erroneous conception. A multiple-party system is no guarantee of democracy. The political history of many countries, including that of pre-revolutionary Russia, makes that fact abundantly evident.",
      "bbox": {
        "x": 0,
        "y": 545,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The one-party system of the Soviet Union evolved naturally out of the struggle to extend democracy to the broadest sections of the population. Before the October Socialist Revolution of 1917 there were many opposing political parties in Russia. With few exceptions, their programs won them no substantial support from the people. On the right were the monarchist League of the Russian People; the Octobrists, who represented the interests of the landlords and the bourgeoisie; and the Constitutional Democrats—the Cadets—who served the big capitalists.",
      "bbox": {
        "x": 0,
        "y": 565,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "Their policies were all dedicated to securing the interests of the bourgeoisie and the landlords, to preserving the monarchy and landed proprietorship, to maintaining the system of colonial oppression of the non-Russian peoples of the czarist empire and to continuing the imperialist war. As a consequence, they lost what narrow support they originally gathered and either faded away before the October Revolution, as had happened with the League of Russian People, or, like the Octobrists and the Constitutional Democrats, degenerated into counterrevolutionary conspiratorial groups that took up arms against the government of the Soviets.",
      "bbox": {
        "x": 0,
        "y": 585,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "In addition to these blatantly reactionary, anti-democratic parties there were the so-called socialist parties—the Mensheviks and the Socialist-Revolutionaries. They opposed the monarchy, favored agrarian reform and proclaimed themselves supporters of socialism. For a time their ostensibly democratic program won them the support of some of the intellectuals, peasants and workers. Finally, there was the Communist Party (Bolsheviks). To explain its origin, we must turn history back a half-century. Prerevolutionary Russia had four basic classes—the landlords, capitalists, workers and peasants.",
      "bbox": {
        "x": 0,
        "y": 605,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The workers and the great mass of the peasants, with the exception of the rich exploiting kulaks, were poverty-stricken. With the development of capitalism in Russia at the turn of the century, the working class grew in size and in strength. The workers and peasants were savagely exploited. They worked 14 to 16 hours a day at wages that were not enough to keep body and soul together. Their bitterness and hatred broke out in spontaneous revolts that the czarist officialdom put down by shooting and hanging strikers and rioters.",
      "bbox": {
        "x": 0,
        "y": 625,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The class struggle had to be channeled and properly organized if the working people were to be eased of their terrible burden of suffering. So thought the best representatives of the people of Russia, like Vladimir Ulyanov (Lenin) and others who came from the intellectuals and from the working class itself. Life demanded the formation of a political party capable of expressing the people's aspirations and of carrying out a policy that accorded with the interests and needs of the working people. Lenin and his comrades-in-arms worked persistently for the creation of such a party.",
      "bbox": {
        "x": 0,
        "y": 645,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "His efforts were concentrated on organizing the working class in order to lead it in a relentless struggle against its exploiters. The Communist Party (Bolsheviks) was founded in 1903. Its organizer was Vladimir Lenin. The ideological weapon it adopted was and remains Marxism, the teachings of Marx and Engels founded on the objective laws that govern the development of society and explain the successive changes of social formations in the process of social development. The Party worked out a plan and tactics of struggle divided into a minimum program and a maximum program.",
      "bbox": {
        "x": 0,
        "y": 665,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The minimum program called for the overthrow of czarism by reasonable tactics and a change in the social order, with the goal of achieving democratic freedoms. The maximum program called for the establishment of the power of the working class, an end to the exploitation of man by man, conversion of the means of production into public property as a basis for building a classless communist society that would use these great productive potentials to satisfy all of man's material and cultural wants. This was, in brief, Lenin's theory of the bourgeois-democratic revolution and its transformation into the socialist revolution which was to create the basis for constructing a classless, communist society.",
      "bbox": {
        "x": 0,
        "y": 685,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "Almost from the moment of its birth the Communist Party was tested in battle. In 1905 the people rose against the czarist autocracy, and the Party marched in the foremost ranks of the revolutionary fighters. No other party so devotedly defended the interests of the working people. But in 1905 the people still lacked the strength to overthrow the old regime, and czarism won. But the party of the Communists continued its work among the people, getting them ready for the decisive revolution which was inevitably brewing since brutal exploitation went on unabated and the people were being stripped of all rights.",
      "bbox": {
        "x": 0,
        "y": 705,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "The Communists were persecuted by the czarist officialdom. With exile, hard prison labor, firing squad and gallows, the autocracy hoped to crush the Communists or to terrorize them until they gave up the revolutionary struggle. But Communists are as indestructible as the working class itself, that endless reservoir from which the Party constantly reinforces itself. In the years following 1905 the Party gained in influence and authority with its steadfast program of struggle for the interests of all working people.",
      "bbox": {
        "x": 0,
        "y": 725,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "Then came the year 1917. The first imperialist war brought the country to the verge of ruin. Starvation and the whip ruled the cities and villages. War-weary and hungry, millions of soldiers refused to fight. This was not their war, they wanted an end to it. The czarist government and all the bourgeois parties demanded that the war go on. Only the Communist Party called on the workers, soldiers and peasants to struggle to overthrow the czarist government and to put a workers' and peasants' government in power that would give the country peace, bread and land, and once and for all put an end to national oppression.",
      "bbox": {
        "x": 0,
        "y": 745,
        "width": 100,
        "height": 20
      }
    },
    {
      "type": "paragraph",
      "text": "In March 1917 the people overthrew the czarist government, but the bourgeoisie seized power and formed a Provisional Government A veteran of the revolutionary movement, the author of this article, Andrei Kuchkin, is an eminent scientist specializing in the history of the Communist Party of the Soviet Union. He is one of the co-authors of the textbook History of the Communist Party of the Soviet Union which has been published in editions totaling many million copies...",
      "bbox": {
        "x": 0,
        "y": 765,
        "width": 100,
        "height": 20
      }
    }
  ]
}
